import React, { Component } from 'react';
import styled from  'styled-components';


class About extends Component {

    render(){
        return(
            <DIV>
               
                <h2>추후 블로그로 사용하기 위해 지속적으로 업데이트 예정입니다</h2>
                <h2>백엔드는 <Boot>Spring Boot</Boot> 를 사용하였고</h2>
                <h2>프론트엔드는 <Reactt>React</Reactt> 를 사용하였습니다.</h2>
                <h2>DB는 <Amazon>아마존의 RDS와 MariaDB</Amazon> 를 사용하였고</h2>
                <h2>서버는 <Amazon>아마존의 AWS</Amazon> 를 사용하였습니다.</h2>
            </DIV>
            
        )
    }

}

export default About;

const DIV = styled.div`
    margin-top: 100px;
    text-align:center;
`

const Boot = styled.b`
  color:green;
`

const Reactt = styled.b`
   color: blue;
`

const Amazon = styled.b`
   color: red;
`
